const pratikImg = require("../../../assets/contacts/pratik.png");
const atulImg = require("../../../assets/contacts/atul.png");
const meghaImg = require("../../../assets/contacts/megha.png");
const sauravImg = require("../../../assets/contacts/saurav.png");
const varunImg = require("../../../assets/contacts/varun.png");
const profileImg = require("../../../assets/contacts/sanket.png");

const data = [
  {
    thumbnail: pratikImg,
    message: "Messi once again crowned the Ballon Dor.",
    name: "Kumar Pratik",
    time: "11:04 AM"
  },
  {
    thumbnail: atulImg,
    message: "Valentino Rossi wins the MotoGP Premier 2016.",
    name: "Atul Ranjan",
    time: "9:44 AM"
  },
  {
    thumbnail: meghaImg,
    message: "Messi once again crowned the Ballon Dor.",
    name: "Megha Kumari",
    time: "6:34 PM"
  },
  {
    thumbnail: sauravImg,
    message: "Avantador is fast. Really fast",
    name: "Saurav",
    time: "Yesterday"
  },
  {
    thumbnail: varunImg,
    message: "It was a beautiful sunset.",
    name: "Varun",
    time: "Yesterday"
  },
  {
    thumbnail: profileImg,
    message: "This is me",
    name: "Sanket Sahu",
    time: "Yesterday"
  }
];

module.exports = data;
